package com.example.mcqgroupbe.entity;

public class TopicAndSetIds {

	private int topicId;
	private int setId;
	
	
	
	public TopicAndSetIds() {
		super();
		// TODO Auto-generated constructor stub
	}
	public TopicAndSetIds(int topicId, int setId) {
		super();
		this.topicId = topicId;
		this.setId = setId;
	}
	public int getTopicId() {
		return topicId;
	}
	public void setTopicId(int topicId) {
		this.topicId = topicId;
	}
	public int getSetId() {
		return setId;
	}
	public void setSetId(int setId) {
		this.setId = setId;
	}
	
	
	
}
